			e.printStackTrace();
		}

		height = lowerRC.getYH();
		width = lowerRC.getXH(); 
	}

	@Override
	public void setAngle (double newAngle) throws IOException {
		if (maxAngle < newAngle || newAngle < minAngle) {
			throw new ImpossibleAngleException("Angle out of range");
		}
		double oldAngle = angle;
		angle = newAngle;
		lowerRC.setAngle(newAngle);
		propertySupport.notifyAllListeners(new PropertyChangeEvent(this, "Angle", oldAngle,
				newAngle));
	}

}

package AnimationMethods;

import grail.compositeFigs.Avatars;
import tags301.Comp301Tags;
import util.annotations.Tags;
import util.misc.ThreadSupport;
@Tags(Comp301Tags.ANIMATOR)
public class ABridgeSceneAnimator implements BridgeSceneAnimator {
	static final int START = 0,
					MOVE_BY = 10,
					GUARD_CLAP = 5,
					MARCH_TIME = 250;
	@Override
	public synchronized void animateAvatar(Avatars anAvatar) {
		int i = START;
    	while (i < MOVE_BY) {
    	ThreadSupport.sleep(MARCH_TIME);
    	anAvatar.moveAvatar(MOVE_BY, START);    	
    	i++;
    	}
	}
	@Override
	public synchronized void animateGuard(Avatars anAvatar) {
		int i = START;
    	while (i < GUARD_CLAP) {
    		if(i%2 == 0) {	
		    	ThreadSupport.sleep(MARCH_TIME);
		    	anAvatar.getArms().getRightLine().rotate(-7);
		    	anAvatar.getArms().getLeftLine().rotate(7);
		    	i++;
    			}
    		else{ThreadSupport.sleep(MARCH_TIME);
	    	anAvatar.getArms().getRightLine().rotate(7);
	    	anAvatar.getArms().getLeftLine().rotate(-7);
	    	i++;}
    	}
	}

}

