		assert preApproach() : "AREA OCCUPIED";
		//if (occupationState) {return;}
		anAvatar.moveAvatar(KNIGHTS_X + OFF_SET - anAvatar.getLegs().getLeftLine().getX(), ARTHUR_Y + OFF_SET - anAvatar.getLegs().getLeftLine().getY());
