		return new RealisticLegs(rad, ang, radR, angR, valX, valY);
//		return new ArmsAndLegs(rad, ang, radR, angR, valX, valY);
	}

	public static SceneView consoleSceneViewFactoryMethod() {
		if (sceneView == null) {
			sceneView = new ConsoleSceneView();
		}
		return sceneView;
	}
	public static ObservableHelp helperFactoryMethod() {
		return new AnObservableHelper();
	}

	public static Tables<Avatars> avatarTableFactoryMethod(){
		if (avatarAndObject == null) {
			avatarAndObject = new MapStringToObject<Avatars>();
		}
		return avatarAndObject;
	}

	public static CustomView inheritingBridgeScenePainterFactoryMethod() {
		if (sceneView2 == null) {
			sceneView2 = new BridgePaintView();
		}
		return sceneView2;
	}
	public static PanelButton bridgeSceneButtonsFactoryMethod() {
		if(sceneButtons == null) {
			sceneButtons = new Buttons();
		}
		return sceneButtons;
	}
	public static KeyController bridgeSceneControllerFactoryMethod(){
		if (bridgeController == null) {
			bridgeController = new BridgeSceneController((Component)inheritingBridgeScenePainterFactoryMethod());
		}
		return bridgeController;

	}
	public static ObservableBridgeScene observableBridgeScenePainterFactoryMethod() {
		if (delegateScene == null) {
			delegateScene = new ObservableScenePainter();
		}
		return delegateScene;
	}
	public static DelegatingScenes delegatingBridgeSceneViewFactoryMethod(){
		if (sceneShowed == null) {
			sceneShowed = new DelegatingScene();
		}
		return sceneShowed;
	}

	public static BroadcastingClearanceManager broadcastingClearanceManagerFactoryMethod() {
		if (clearanceManager == null) {
			clearanceManager = new ABroadcastingClearanceManager();
		}
		return clearanceManager;

	}


}

package AnimationMethods;

import java.beans.PropertyChangeListener;


import util.annotations.ComponentWidth;
import util.annotations.Row;
import util.models.AListenableVector;
import util.models.ListenableVector;
import bus.uigen.ObjectEditor;
import grail.MVC.AnObservableHelper;
import grail.MVC.ObservableHelp;

public class AClearanceManager implements ClearanceManager {
	ListenableVector waitingThreads = new AListenableVector<>();
	ObservableHelp propertyListenerSupport = new AnObservableHelper();
	@Row(0)
	@ComponentWidth(150)
	public synchronized void proceed() {
		System.out.println( Thread.currentThread() + ": before notify");
		notify(); // Defined in call Object. Hover over it to see its explanation. Think of a monitor as simply an object.
		System.out.println( Thread.currentThread() + ": after notify");
	}
	public 
//		 Comment out the synchronized keyword. What error do you get? 
		synchronized 
			void waitForProceed() {
			try {
				String aThreadID = Thread.currentThread().toString();
				System.out.println( aThreadID + ": before wait");
				waitingThreads.addElement(aThreadID);
				wait(); // Defined in call Object. Hover over it to see its explanation. Think of a monitor as simply an object.
				System.out.println( aThreadID + ": after wait");
				waitingThreads.removeElement(aThreadID);
			} catch (Exception e) {
				e.printStackTrace();
			}
//		}
	}
	@Row(2)
	public ListenableVector getWaitingThreads() {
		return waitingThreads;

	}
	@Override
	public void addPropertyChangeListener(PropertyChangeListener arg0) {
		propertyListenerSupport.add(arg0);
	}

}

package AnimationMethods;

import util.annotations.ComponentWidth;
import util.annotations.Row;

public class ABroadcastingClearanceManager extends AClearanceManager 
					implements BroadcastingClearanceManager {

	@Row(1)
	@ComponentWidth(150)
	public synchronized void proceedAll() {
		notifyAll(); // not notify, hover over the method and see Java's explanation for it		
		System.out.println( Thread.currentThread()  + ": after notifyAll");

	}
}

